import Route from "./Componets/Route";
import MainContainer from "./Container/MainAppContainer";
import Login from "./Container/Pages/Login";
import Character from "./Logic/tavadar";

const App = () => {
  const [character] = useState(Character);

  const diceRoller = () => {
    console.log("I am dice roller button");
  };

  return (
    <div>
      <Route path="/">
        <Login />
      </Route>
      <Route path="/app">
        <MainContainer character={character} />
      </Route>
    </div>
  );
};

export default App;

